import React from "react";
import "./App.css";
// import NotFound from "pages/NotFound";
// import AppBar from "components/AppBar";
// import MasterPage from "pages/MasterPage";
import LoaderComponent from "pages/MasterPage";
import { Card, Text, ShellBar, ThemeProvider, CardHeader, Icon } from "@ui5/webcomponents-react";
import "@ui5/webcomponents-icons/dist/AllIcons.js";



const App = () => {

  return (
    <div className="App full-height">
      <ThemeProvider>
        <ShellBar
          logo={<img src="logo192.png" />}
          primaryTitle="React with UI5 Web Component with CAP API"
        ></ShellBar>

      </ThemeProvider>
    </div>
  );
};

export default App;
